using System;
using System.Collections.Generic;
using System.Drawing;
using System.IO;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace base64ImageLoader
{
    class Program
    {
        static string StrImageDataBase64 = @"";

        static void Main(string[] args)
        {
            byte[] bytes = Convert.FromBase64String(StrImageDataBase64);

            Image image;
            using (MemoryStream ms = new MemoryStream(bytes))
            {
                image = Image.FromStream(ms);
            }

            image.Save(@"D:/TTT/base64Image.bmp");
        }
    }
}
